import React from 'react';
import accueil from '../images/accueil.jpg'
import '../styles/Acceuil.css'
import Programmation from './Programmation';
import Concerts from './Concerts';
import { NavLink } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css'; // importez la CSS de Bootstrap

function Acceuil() {

    return (
        <div className='container-fluid'>
            <img src={accueil} alt="accueil" className="accueil" />
            <div className="row justify-content-center">
                <div className="col-md-6 text-center">
                    <h1 className='titre mt-5'>CONCRETE<br /> JUNGLE<br /> FESTIVAL</h1>
                    <p className='date mt-3'>15 JUILLET 2024</p>
                </div>
            </div>
            <NavLink to="/boutique" className="bouton-billetterie py-2 px-3 mt-5 text-center">BILLETTERIE</NavLink>
            <Programmation />
            <Concerts />
        </div>
    );
}

export default Acceuil;
